import React,{useState} from 'react';
import { FormControl, FormGroup, InputLabel, Input, Typography, Button } from '@mui/material';
import styled from '@emotion/styled';
import axios from 'axios';
import AdminNavBar from './NavBars/AdminNavBar';

const Container = styled(FormGroup)`
    width:50%;
    margin: 5% 30%;
    & > div {
        margin-top:20px;
    }
`

const UploadAdmin = () => {
    const [files, setFiles] = useState([]);

    return(
        <Container>
            <AdminNavBar/>
            <Typography variant='h4'>Upload Documents</Typography>
            <FormControl>
                <InputLabel>Upload File</InputLabel>
                <Input name="upload" type='file' onChange={(e)=> {setFiles(e.target.value)}}/>
            </FormControl>
        </Container>
    )

}

export default UploadAdmin;
